Paper Artifact ‚Äì A monochrome abstract Bouquet printed on paper ‚Äì A study about geometry, light and transparency, an experiment about energy and beauty emerging from simple shapes, compositions and randomness, seen through the roughness of an old printer.

// Paper Camera ‚Äì This project is paired with a physical device, the ‚ÄúPaper Camera‚Äù. An experiment mixing a physical device and generative art. Beyond the classic Fx(Hash) collection, an opportunity to generate new outputs using your portrait as a seed and to get the result printed on thermal paper.

//Learn more about the project:
https://www.parseerror.net/portfolio/paper-camera/ 

Two ways to generate outputs:

// The classic way: 
- By minting an edition on FxHash! :)

// The paper way (using the physical device):
- Stand in front of the Paper Camera and press the button
- The device captures your portrait
- Your portrait is used as a seed to generate an output
- The device prints your photo + generated art + QR Code
- Scan the QR code to watch your output live on a screen

Note: The outputs generated by the Paper Camera are not NFTs and are not part of the collection available on Fx(Hash). This new way of generating outputs is a playful approach to let people experience the joy of minting generative art in a physical setup (during exhibitions or events) and to play with the project with a new perspective. 

Controls
// S - Save as high resolution png
// C - Unlock camera (use your mouse, rotate/zoom to find new views!)
// On mobile ‚Äì Double tap to unlock the camera

Made with ThreeJS
2022 - Parse/Error

[Bullet] is metaphor about forgiveness, bravery and us

// background();
Each bullet grows up in different backgrounds, they might be pretty and rich in color but also can be pale and poor, like every one of us, bullet cannot choose where it came from and its own past story background. 

// growLogic();
instead of using anger/angst to deal with its life and living with worries, complaints, and fears in the pale past. Bullet chose to understand / organize and extract the best from the past. 

Bullet found the best moments/elements in its past as paints for the future, weave its body and soul with these enhanced colors it picked and turn them into the present self. 

Each bullet are fighting hard to grow/transform and become the best version of itself. 

// A letter to us:
Be brave like this bullet head. 
It swims in the air with no regrets,
and breaks thru all the sonic barriers wall ahead. 

Some bullet's dresses were made up of words. 
Those are the bits I would like to share with every one of us in this room of 256.


'accept your past and everything you owned‚Ä¢',
'do not hate your past as it will not help but only burden your moves',
'from now on you are whoever you want to be',
'they are part of your past but you are all in your future,
'break the thick air wall surrounding you',
'no need to forget, try to forgive',
'Breakthru your future by your past',
'like a bullet, you fly towards your target but not hatred'

// the work is best viewed by new window with a large display area
// refresh the page once u resized the window everytime to have best result.
// proportion and color intensity might vary a bit via different resolutions as Bullet is finely crafted and drawn to unit-pixel scale.
// press s in new window with your desire screen size to export artwork as png

